using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UITableViewHeaderFooterView_class/index.html#//apple_ref/occ/cl/UITableViewHeaderFooterView	/// <summary>	/// The UITableViewHeaderFooterView class implements a reusable view that can be placed at the top or bottom of a table section. You use headers and footers to display additional information for that section.	/// </summary>	[iOSVersion(6)]	public class UITableViewHeaderFooterView : UIView	{		/// <summary>		/// Initializes a header/footer view with the specified reuse identifier.		/// </summary>		/// <param name="reuseIdentifier">A string used to identify the header or footer view if it is to be reused by multiple sections. Pass nil if the view is not to be reused. You should use the same reuse identifier for all header or footer views of the same form.</param>		/// <returns>An initialized UITableViewHeaderFooterView object or nil if the object could not be created.</returns>		[iOSVersion(6)]		public UITableViewHeaderFooterView(string reuseIdentifier) { }				/// <summary>		/// The content view of the header or footer. (read-only)		/// </summary>		[iOSVersion(6)]		[Export("contentView")]		public UIView ContentView { get; private set; }				/// <summary>		/// The background view of the header or footer.		/// </summary>		[iOSVersion(6)]		[Export("backgroundView")]		public UIView BackgroundView { get; set; }				/// <summary>		/// A string used to identify a reusable header or footer. (read-only)		/// </summary>		[iOSVersion(6)]		[Export("reuseIdentifier")]		public string ReuseIdentifier { get; private set; }				/// <summary>		/// Prepares a reusable header or footer view for reuse by the table.		/// </summary>		[iOSVersion(6)]		[Export("prepareForReuse")]		public void PrepareForReuse() { }				/// <summary>		/// A primary text label for the view. (read-only)		/// </summary>		[iOSVersion(6)]		[Export("textLabel")]		public UILabel TextLabel { get; private set; }				/// <summary>		/// A detail text label for the view. (read-only)		/// </summary>		[iOSVersion(6)]		[Export("detailTextLabel")]		public UILabel DetailTextLabel { get; private set; }				/// <summary>		/// The tint color of the view.		/// </summary>		[iOSVersion(6)]		[Export("tintColor")]		public UIColor TintColor { get; set; }	}}